import React from "react";
import "./Jumbotron.css";

const Jumbotron = () => (
    <div class="jumbotron">
      <h1 class="text-center">
        <strong><i class="fa fa-newspaper-o"></i> New York Times Search</strong>
      </h1>
    </div>
);

export default Jumbotron;
